import "../App.css";
import logoImg from "../img/logo.jpg";

function Home() {
  function handlePress() {
    localStorage.clear();
    window.location = "/";
    window.reload();
  }
  return (
    <div className="App">
      <div className="navbar">
        <div className="minNav">
          <img src={logoImg} alt="" />
          {localStorage.getItem("key") ? (
            localStorage.getItem("key") == 1 ? (
              <div className="bgasc" 
              style={{
                width: "27%",
                display: "flex",
                justifyContent: "space-between",
              }}>
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <a href="/admin">
                  <button>Админ панел</button>
                </a>

                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : localStorage.getItem("key") == 2 ? (
              <div
                style={{
                  width: "15%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : localStorage.getItem("key") == 3 ? (
              <div className="bgasc" 
              style={{
                width: "27%",
                display: "flex",
                justifyContent: "space-between",
              }}>
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <a href="/manager">
                  <button>Админ панел</button>
                </a>

                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : (
              <a href="/login">
                <button>Войти</button>
              </a>
            )
          ) : (
            <a href="/login">
              <button>Войти</button>
            </a>
          )}
          {/* {localStorage.getItem("key") ? (
            <a href="/profile">
              <button>Профиль</button>
              <button
                style={{ marginLeft: "10px" }}
                onClick={() => handlePress()}
              >
                Выйти
              </button>
            </a>
          ) : (
            <a href="/login">
              <button>Войти</button>
            </a>
          )} */}
        </div>
      </div>
      <div className="header">
        <div className="shadowDiv" />
        <div className="inputForm">
          <input
            type="text"
            placeholder="Введите трек-код (номер отслеживания)"
          />
          <button>Найти</button>
        </div>
      </div>
     
      <div className="footer">
        <div style={{ marginLeft: "10%" }}>
          <a href="" style={{ color: "#800000" }}>
            ⋅ Политика конфиденциальности
          </a>
          <p style={{ color: "gray" }}>© 2B LOGISCTIC EXPRESS CARGO</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
